import React from 'react'
import HomeApp from './components/Homebox/Home/home';
import './index.css';


function App() {
  return (
    <div>
      <Router>
            <Switch>
              <Route path="/" exact component={<HomeApp/>}></Route>
              {/* <Route path="/WorkOut" component={Workout}></Route> */}

            </Switch>
        </Router>

    </div>
  );
}

export default App;
